parameters.query:
SELECT EXISTS (
    SELECT 1
    FROM invoice_client_embeddings
    WHERE trim(metadata->>'client_number') = trim($1)
      AND trim(metadata->>'book_number')   = trim($2)
) AS is_matched;

parameters.inputSchema:
{
  "type": "object",
  "required": ["invoice_client_info"],
  "additionalProperties": false,
  "properties": {
    "invoice_client_info": {
      "type": "object",
      "description": "Parse exactly from text. If any field is not found, set it to \"\" (empty string). Do not guess.",
      "required": ["book_number", "organization", "address"],
      "additionalProperties": false,
      "properties": {
        "book_number": {
          "type": "string",
          "description": "Exact book_number from context. If absent, set to \"\".",
          "default": ""
        },
        "organization": {
          "type": "object",
          "description": "Recipient's organization (may be the recipient itself). No guessing—use \"\" when unknown.",
          "required": [
            "name",
            "city",
            "state",
            "country_code",
            "url_website",
            "url_linkedin",
            "verified",
            "email"
          ],
          "additionalProperties": false,
          "properties": {
            "name": {
              "type": "string",
              "description": "Organization name.",
              "default": ""
            },
            "city": {
              "type": "string",
              "description": "Organization city.",
              "default": ""
            },
            "state": {
              "type": "string",
              "description": "Organization state/region.",
              "default": ""
            },
            "country_code": {
              "type": "string",
              "description": "ISO 2-letter code if provided; otherwise \"\".",
              "default": ""
            },
            "url_website": {
              "type": "string",
              "description": "Website URL if provided; otherwise \"\".",
              "default": ""
            },
            "url_linkedin": {
              "type": "string",
              "description": "LinkedIn URL if provided; otherwise \"\".",
              "default": ""
            },
            "verified": {
              "type": "boolean",
              "description": "Always set to false unless explicitly stated as verified.",
              "default": false
            },
            "email": {
              "type": "string",
              "description": "Organization email if provided; otherwise \"\".",
              "default": ""
            }
          }
        },
        "address": {
          "type": "object",
          "description": "Invoice recipient's mailing details only. Use \"\" when not present.",
          "required": [
            "name",
            "address_line_1",
            "address_line_2",
            "city",
            "state",
            "postal_code",
            "country"
          ],
          "additionalProperties": false,
          "properties": {
            "name": {
              "type": "string",
              "description": "Invoice Recipient provided.",
              "default": ""
            },
            "address_line_1": {
              "type": "string",
              "description": "Primary street address.",
              "default": ""
            },
            "address_line_2": {
              "type": "string",
              "description": "Apt/Suite/Unit/etc.",
              "default": ""
            },
            "city": {
              "type": "string",
              "description": "Recipient city.",
              "default": ""
            },
            "state": {
              "type": "string",
              "description": "Recipient state/region.",
              "default": ""
            },
            "postal_code": {
              "type": "string",
              "description": "Postal/ZIP code.",
              "default": ""
            },
            "country": {
              "type": "string",
              "description": "Country name or code.",
              "default": ""
            }
          }
        }
      }
    }
  }
}
